Sensing Murder (America version 4:3)

Basement Horror

Season 1, Episode 6. Aired Thursday, Oct. 26, 2006.

On May 22, 2004, 53-year-old Al Kite was murdered in his home in Aurora, Colo. He was struck in the head and then tortured for hours before he died in the basement apartment of his town house. Two years later, investigators have a prime suspect but no motive, and no fresh leads. Spurred on by Al Kite's family, the detectives have agreed to work with Pam and Laurie to find new clues to this shocking, cold-blooded murder. Al's sister is desperate for answers, as are the detectives assigned to this baffling case. What new leads will Pam and Laurie give to the detectives? What fresh insights will they reveal? Will their psychic visions uncover the whereabouts of the prime suspect?

